import React, { useEffect, useState, Fragment } from "react";
import BarByCompany from "../Components/BarByCompany";

const Home = () => {

  const [dict, setDict] = useState([]);
  const getDict = async () => {
    try {
      const response = await fetch("http://localhost:5000/");
      const jsonData = await response.json();
      setDict(jsonData);
      console.log(jsonData);
    } catch (err) {
      console.error(err.message);
    }
  };

  useEffect(() => {
    getDict();
  }, []);

  const list_keys = [];
  const list_values = [];

  for (const key in dict) {
    list_keys.push(key);
    list_values.push(dict[key]);
  }

  console.log(list_values);
  console.log(list_values);

  const levels_test = ["one", "two", "three", "four"]

  return (
    <Fragment>
      <table class="table mt-5 text-center">
        <thead>
          <tr>
            <th>Description</th>
            <th>Edit</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
          {levels_test.map(level => (
            <tr>
              <td>{level}</td>
              <td>
                {level}
              </td>
              <td>
                {level}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </Fragment>

  );
};

export default Home;
